"use strict";
Page({
    data: {
        licNo: '',
        name: '',
        genderIndex: 0,
        genders: ['未知', '男', '女', '其他'],
        birthDate: '1990-01-01',
        licImgURL: '',
        state: 'UNSUBMITTED'
    },
    onUploadLic() {
        wx.chooseImage({
            success: res => {
                if (res.tempFilePaths.length > 0) {
                    this.setData({
                        licImgURL: res.tempFilePaths[0]
                    });
                    setTimeout(() => {
                        this.setData({
                            licNo: '3243633254',
                            name: '张三',
                            genderIndex: 1,
                            birthDate: '1999-12-23',
                        });
                    }, 1000);
                }
            }
        });
    },
    onGenderChange(e) {
        this.setData({
            genderIndex: e.detail.value,
        });
    },
    onBirthDateChange(e) {
        this.setData({
            birthDate: e.detail.value,
        });
    },
    onSubmit() {
        this.setData({
            state: 'PENDING',
        });
        setTimeout(() => {
            this.onLicVerified();
        }, 3000);
    },
    onReSubmit() {
        this.setData({
            state: 'UNSUBMITTED',
            licImgURL: '',
        });
    },
    onLicVerified() {
        this.setData({
            state: 'VERIFIED',
        });
        wx.redirectTo({
            url: '/pages/lock/lock',
        });
    }
});
